class PD(PDFTemplateView):
    footer_template = 'footer.html'
    header_template = 'header.html'
    template_name = 'tmp2.html'
    cmd_options = {
        'footer-right': '[page]',

    }

    def get(self, request, *args, **kwargs):
        import pdb;pdb.set_trace()
        response_class = self.response_class
        data: dict = json.loads(payload)

        self.extra_context = {
            'stands': data['data'],
            'img': data['image']
        }

        try:
            if request.GET.get('as', '') == 'html':
                # Use the html_response_class if HTML was requested.
                self.response_class = self.html_response_class
            return super(PDFTemplateView, self).get(request,
                                                    *args, **kwargs)
        finally:
            # Remove self.response_class
            self.response_class = response_class


class HD(TemplateView):
    template_name = 'tmp2.html'
    extra_context = {
        'stands': json.loads(payload)['data']
    }


